import React from 'react';
import './App.css';
import Navbar from './Nav/Navbar';
import { BrowserRouter as Router, Switch, Route} from "react-router-dom";

/*
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect"; 
*/

function App() {
  return (
    <Router>
        <div className="app">
            <Switch>
                <Route path="/language">
                    <Navbar />
                    language
                </Route>
                <Route path="/aboutus">
                    <Navbar />
                    about us
                </Route>
                <Route path="/">
                    <Navbar />
                    home
                </Route>
            </Switch>
        </div>
    </Router>
  );
}

export default App;
